import React, {Component} from 'react';
import { ListGroup, ListGroupItem, FormGroup, Input, Form, Button } from 'reactstrap';
import { BrowserRouter, Link } from "react-router-dom";







class WorkingCities  extends Component {


    render(){
        return(
                <div className="working_cities">
                    <div className="container">
                        <h3 className="service_title text-capitalize font-weight-bold">Building Contractor Service In Our Working Cities</h3>
                        <FormGroup className="select_location">
                            <Input type="select" name="select" id="exampleSelect">
                                <option>Select Service In Our Working Cities</option>
                                <option>2</option>
                                <option>3</option>
                                <option>4</option>
                                <option>5</option>
                            </Input>
                        </FormGroup>
                    </div>
                </div>

            
        );

        
    }

}
export default  WorkingCities;
